/* Taken from Stackoverflow */
export function randomIntFromInverval(min, max) {
    return Math.floor(Math.random() * (max - min + 1) + min);
}

/* Taken from Stackoverflow */
export function pause(milliseconds) {
	var dt = new Date();
	while ((new Date()) - dt <= milliseconds) { /* Do nothing */ }
}
